import React, { Component } from 'react'
import GoogleMap from 'google-map-react'

const API_KEY = "AIzaSyC6PUOxo26piQBw2RGg6uLjEtVQY4XzN9Y";

export default class Main extends Component {
    render() {
        return (
            <div>
                <GoogleMap
                bootstrapURLKeys={{
                    key: API_KEY,
                    language: 'en',
                    region: 'en',
                    libraries:['places'],
                    ...otherUrlParams,
                  }}>

                </GoogleMap>
            </div>
        )
    }
}
